import React from "react";
import {
  Box,
  Card,
  CardActions,
  Link,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@mui/material";

import AccountCircleIcon from "@mui/icons-material/AccountCircle";
const Logincomponent2 = () => {
  return (
    <Box>
      <Button className="icon_login">
        <AccountCircleIcon />
      </Button>
      <Card>
        <img
          src="https://i.pinimg.com/originals/82/be/d4/82bed479344270067e3d2171379949b3.png"
          alt=""
          style={{ objectFit: "cover", maxHeight: "15vh", maxWidth: "15vh" }}
        />
      </Card>
    </Box>
  );
};

export default Logincomponent2;
